import React from 'react';
import './reviews.css';
function Reviews() {
return (
<div className="navbar-content">
   <h1 className="logo">
      Reviews
   </h1>
   <div className="navbar-text">
      <p>Product</p>
      <p>Features</p>
      <p>Marketplace</p>
      <p>Company</p>
      <p>Log-in</p>
   </div>
</div>
)}
export default Reviews;
